    <span class="token keyword">for</span> i<span class="token punctuation">,</span> <span class="token punctuation">(</span>image<span class="token punctuation">,</span> filename<span class="token punctuation">)</span> <span class="token keyword">in</span> <span class="token builtin">enumerate</span><span class="token punctuation">(</span><span class="token builtin">zip</span><span class="token punctuation">(</span>images<span class="token punctuation">,</span> filenames<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">:</span>
        hash_value <span class="token operator">=</span> phash<span class="token punctuation">(</span>Image<span class="token punctuation">.</span>fromarray<span class="token punctuation">(</span>image<span class="token punctuation">)</span><span class="token punctuation">)</span>
        hash_to_image<span class="token punctuation">[</span>hash_value<span class="token punctuation">]</span><span class="token punctuation">.</span>append<span class="token punctuation">(</span><span class="token punctuation">(</span>i<span class="token punctuation">,</span> filename<span class="token punctuation">)</span><span class="token punctuation">)</span>

    num_duplicates <span class="token operator">=</span> <span class="token number">0</span>
    <span class="token keyword">for</span> hash_value<span class="token punctuation">,</span> indexes <span class="token keyword">in</span> hash_to_image<span class="token punctuation">.</span>items<span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">:</span>
