            <span class="token comment"># If the hash value is already in the dictionary, this image is a duplicate</span>
            duplicate_indices<span class="token punctuation">.</span>add<span class="token punctuation">(</span>i<span class="token punctuation">)</span>  <span class="token comment"># Add index to set of duplicates</span>
        <span class="token keyword">else</span><span class="token punctuation">:</span>
            hash_to_image<span class="token punctuation">[</span>hash_value<span class="token punctuation">]</span> <span class="token operator">=</span> i  <span class="token comment"># Store hash value and index</span>
