    compressed_images <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token punctuation">]</span>
    <span class="token keyword">for</span> image <span class="token keyword">in</span> images<span class="token punctuation">:</span>
        compressed_channels <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token punctuation">]</span>
        <span class="token keyword">for</span> i <span class="token keyword">in</span> <span class="token builtin">range</span><span class="token punctuation">(</span>image<span class="token punctuation">.</span>shape<span class="token punctuation">[</span><span class="token number">2</span><span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">:</span>  <span class="token comment"># Loop through each channel (R, G, B)</span>
            channel <span class="token operator">=</span> image<span class="token punctuation">[</span><span class="token punctuation">:</span><span class="token punctuation">,</span> <span class="token punctuation">:</span><span class="token punctuation">,</span> i<span class="token punctuation">]</span>  <span class="token comment"># Extract the channel</span>
            <span class="token comment"># Initialize TruncatedSVD</span>
            svd <span class="token operator">=</span> TruncatedSVD<span class="token punctuation">(</span>n_components<span class="token operator">=</span>k<span class="token punctuation">)</span>
            <span class="token comment"># Perform SVD on the channel</span>
            transformed <span class="token operator">=</span> svd<span class="token punctuation">.</span>fit_transform<span class="token punctuation">(</span>channel<span class="token punctuation">)</span>
            <span class="token comment"># Reconstruct the channel</span>
            compressed_channel <span class="token operator">=</span> svd<span class="token punctuation">.</span>inverse_transform<span class="token punctuation">(</span>transformed<span class="token punctuation">)</span>
            compressed_channels<span class="token punctuation">.</span>append<span class="token punctuation">(</span>compressed_channel<span class="token punctuation">)</span>
        <span class="token comment"># Stack the channels back into an image</span>
        compressed_image <span class="token operator">=</span> np<span class="token punctuation">.</span>stack<span class="token punctuation">(</span>compressed_channels<span class="token punctuation">,</span> axis<span class="token operator">=</span><span class="token number">2</span><span class="token punctuation">)</span>
        compressed_images<span class="token punctuation">.</span>append<span class="token punctuation">(</span>compressed_image<span class="token punctuation">)</span>
    <span class="token keyword">return</span> compressed_images

