<span class="token keyword">def</span> <span class="token function">plot_images</span><span class="token punctuation">(</span>dataset<span class="token punctuation">,</span> title<span class="token punctuation">)</span><span class="token punctuation">:</span>
    plt<span class="token punctuation">.</span>figure<span class="token punctuation">(</span>figsize<span class="token operator">=</span><span class="token punctuation">(</span><span class="token number">15</span><span class="token punctuation">,</span> <span class="token number">3</span><span class="token punctuation">)</span><span class="token punctuation">)</span>  <span class="token comment"># Width, height in inches for the entire row</span>
    plt<span class="token punctuation">.</span>suptitle<span class="token punctuation">(</span>title<span class="token punctuation">)</span> <span class="token comment"># Set title above the images</span>
    <span class="token keyword">for</span> i <span class="token keyword">in</span> <span class="token builtin">range</span><span class="token punctuation">(</span><span class="token number">5</span><span class="token punctuation">)</span><span class="token punctuation">:</span> <span class="token comment"># Show the first 5 images of the data set</span>
        ax <span class="token operator">=</span> plt<span class="token punctuation">.</span>subplot<span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">,</span> <span class="token number">5</span><span class="token punctuation">,</span> i <span class="token operator">+</span> <span class="token number">1</span><span class="token punctuation">)</span> <span class="token comment"># 1 row, 5 columns, index i+1 for the current plot</span>
        img <span class="token operator">=</span> dataset<span class="token punctuation">[</span>i<span class="token punctuation">]</span> <span class="token comment"># Access each image in the dataset</span>
        img <span class="token operator">=</span> np<span class="token punctuation">.</span>clip<span class="token punctuation">(</span>img<span class="token punctuation">,</span> <span class="token number">0</span><span class="token punctuation">,</span> <span class="token number">255</span><span class="token punctuation">)</span> <span class="token comment"># Make sure that the image values are in the range [0, 255]</span>
        plt<span class="token punctuation">.</span>imshow<span class="token punctuation">(</span>img<span class="token punctuation">.</span>astype<span class="token punctuation">(</span><span class="token string">'uint8'</span><span class="token punctuation">)</span><span class="token punctuation">)</span>  <span class="token comment"># Plot the image, convert to uint8 if necessary</span>
        plt<span class="token punctuation">.</span>axis<span class="token punctuation">(</span><span class="token string">'off'</span><span class="token punctuation">)</span> <span class="token comment"># Hide axes</span>
    plt<span class="token punctuation">.</span>show<span class="token punctuation">(</span><span class="token punctuation">)</span>

<span class="token triple-quoted-string string">''' Data Augmentation'''</span>
<span class="token keyword">class</span> <span class="token class-name">CustomTransform</span><span class="token punctuation">:</span>
    <span class="token keyword">def</span> <span class="token function">__call__</span><span class="token punctuation">(</span>self<span class="token punctuation">,</span> image<span class="token punctuation">)</span><span class="token punctuation">:</span>
        <span class="token comment"># Apply Gaussian blur</span>
        image <span class="token operator">=</span> image<span class="token punctuation">.</span><span class="token builtin">filter</span><span class="token punctuation">(</span>ImageFilter<span class="token punctuation">.</span>GaussianBlur<span class="token punctuation">(</span><span class="token number">2</span><span class="token punctuation">)</span><span class="token punctuation">)</span>

        <span class="token comment"># Convert image to numpy array for noise addition</span>
        np_image <span class="token operator">=</span> np<span class="token punctuation">.</span>array<span class="token punctuation">(</span>image<span class="token punctuation">)</span> <span class="token operator">/</span> <span class="token number">255.0</span>  <span class="token comment"># Normalize for noise processing</span>
        noise <span class="token operator">=</span> np<span class="token punctuation">.</span>random<span class="token punctuation">.</span>normal<span class="token punctuation">(</span><span class="token number">0</span><span class="token punctuation">,</span> <span class="token number">0.01</span><span class="token punctuation">,</span> np_image<span class="token punctuation">.</span>shape<span class="token punctuation">)</span>
        np_image <span class="token operator">=</span> np<span class="token punctuation">.</span>clip<span class="token punctuation">(</span>np_image <span class="token operator">+</span> noise<span class="token punctuation">,</span> <span class="token number">0</span><span class="token punctuation">,</span> <span class="token number">1</span><span class="token punctuation">)</span>

        <span class="token comment"># Convert back to PIL image</span>
        <span class="token keyword">return</span> Image<span class="token punctuation">.</span>fromarray<span class="token punctuation">(</span><span class="token punctuation">(</span>np_image <span class="token operator">*</span> <span class="token number">255</span><span class="token punctuation">)</span><span class="token punctuation">.</span>astype<span class="token punctuation">(</span><span class="token string">'uint8'</span><span class="token punctuation">)</span><span class="token punctuation">)</span>

<span class="token comment"># Transformation pipeline</span>
<span class="token comment"># Transformation pipeline</span>
augment_transform <span class="token operator">=</span> transforms<span class="token punctuation">.</span>Compose<span class="token punctuation">(</span><span class="token punctuation">[</span>
    transforms<span class="token punctuation">.</span>RandomHorizontalFlip<span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">,</span>  <span class="token comment"># Random horizontal flip</span>
    transforms<span class="token punctuation">.</span>RandomVerticalFlip<span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">,</span>    <span class="token comment"># Random vertical flip</span>
    transforms<span class="token punctuation">.</span>RandomRotation<span class="token punctuation">(</span><span class="token number">20</span><span class="token punctuation">)</span><span class="token punctuation">,</span>      <span class="token comment"># Random rotation up to 20 degrees</span>
    CustomTransform<span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">,</span>                  <span class="token comment"># Custom transformation for blurring and noise</span>
    transforms<span class="token punctuation">.</span>ToTensor<span class="token punctuation">(</span><span class="token punctuation">)</span>               <span class="token comment"># Convert images to PyTorch tensors</span>
<span class="token punctuation">]</span><span class="token punctuation">)</span>

<span class="token keyword">def</span> <span class="token function">apply_transforms</span><span class="token punctuation">(</span>dataset<span class="token punctuation">,</span> num_augmentations<span class="token operator">=</span><span class="token number">3</span><span class="token punctuation">)</span><span class="token punctuation">:</span>
    augmented_images <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token punctuation">]</span>
    <span class="token keyword">for</span> img <span class="token keyword">in</span> dataset<span class="token punctuation">:</span>
        <span class="token comment"># Convert the NumPy array to a PIL image if not already one</span>
        <span class="token keyword">if</span> <span class="token builtin">isinstance</span><span class="token punctuation">(</span>img<span class="token punctuation">,</span> np<span class="token punctuation">.</span>ndarray<span class="token punctuation">)</span><span class="token punctuation">:</span>
            img <span class="token operator">=</span> Image<span class="token punctuation">.</span>fromarray<span class="token punctuation">(</span>img<span class="token punctuation">.</span>astype<span class="token punctuation">(</span><span class="token string">'uint8'</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
        original_img <span class="token operator">=</span> transforms<span class="token punctuation">.</span>ToTensor<span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">(</span>img<span class="token punctuation">)</span>  <span class="token comment"># Convert original image to tensor</span>
        augmented_images<span class="token punctuation">.</span>append<span class="token punctuation">(</span>original_img<span class="token punctuation">)</span>  <span class="token comment"># Add original image to the list</span>
        <span class="token keyword">for</span> _ <span class="token keyword">in</span> <span class="token builtin">range</span><span class="token punctuation">(</span>num_augmentations<span class="token punctuation">)</span><span class="token punctuation">:</span>
            <span class="token comment"># Apply transformation</span>
            transformed_img <span class="token operator">=</span> augment_transform<span class="token punctuation">(</span>img<span class="token punctuation">)</span>
            augmented_images<span class="token punctuation">.</span>append<span class="token punctuation">(</span>transformed_img<span class="token punctuation">)</span>  <span class="token comment"># Add transformed image to list</span>
    <span class="token keyword">return</span> augmented_images

