Number of benign images (test): 4996</pre><div class="input input-md"><span class="heading"><h3 id="-8-add-black-border-"> 8. Add Black Border <a href="#-8-add-black-border-"> ¬∂</a></h3></span></div><div class="input input-code"><pre class="language-python"><code class="language-python"><span class="token keyword">def</span> <span class="token function">mask_image_to_smaller_circle_for_dataset</span><span class="token punctuation">(</span>images<span class="token punctuation">)</span><span class="token punctuation">:</span>
    result_images <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token punctuation">]</span>
    <span class="token keyword">for</span> tensor_image <span class="token keyword">in</span> images<span class="token punctuation">:</span>
        <span class="token comment"># Convert tensor to numpy array and ensure it's in uint8 format</span>
        image <span class="token operator">=</span> tensor_image<span class="token punctuation">.</span>permute<span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">,</span> <span class="token number">2</span><span class="token punctuation">,</span> <span class="token number">0</span><span class="token punctuation">)</span><span class="token punctuation">.</span>cpu<span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>numpy<span class="token punctuation">(</span><span class="token punctuation">)</span>  <span class="token comment"># Change from CxHxW to HxWxC</span>
        image <span class="token operator">=</span> <span class="token punctuation">(</span>image <span class="token operator">*</span> <span class="token number">255</span><span class="token punctuation">)</span><span class="token punctuation">.</span>astype<span class="token punctuation">(</span>np<span class="token punctuation">.</span>uint8<span class="token punctuation">)</span>

        <span class="token comment"># Convert numpy array to PIL Image</span>
        img <span class="token operator">=</span> Image<span class="token punctuation">.</span>fromarray<span class="token punctuation">(</span>image<span class="token punctuation">)</span>
        w<span class="token punctuation">,</span> h <span class="token operator">=</span> img<span class="token punctuation">.</span>size

        <span class="token comment"># Create a mask to cover the image with an ellipse</span>
        mask <span class="token operator">=</span> Image<span class="token punctuation">.</span>new<span class="token punctuation">(</span><span class="token string">'L'</span><span class="token punctuation">,</span> <span class="token punctuation">(</span>w<span class="token punctuation">,</span> h<span class="token punctuation">)</span><span class="token punctuation">,</span> <span class="token number">0</span><span class="token punctuation">)</span>
        draw <span class="token operator">=</span> ImageDraw<span class="token punctuation">.</span>Draw<span class="token punctuation">(</span>mask<span class="token punctuation">)</span>
        center_x<span class="token punctuation">,</span> center_y <span class="token operator">=</span> w <span class="token operator">//</span> <span class="token number">2</span><span class="token punctuation">,</span> h <span class="token operator">//</span> <span class="token number">2</span>
        radius <span class="token operator">=</span> <span class="token builtin">int</span><span class="token punctuation">(</span><span class="token builtin">min</span><span class="token punctuation">(</span>center_x<span class="token punctuation">,</span> center_y<span class="token punctuation">)</span> <span class="token operator">*</span> <span class="token number">0.8</span><span class="token punctuation">)</span>

        draw<span class="token punctuation">.</span>ellipse<span class="token punctuation">(</span><span class="token punctuation">(</span>center_x <span class="token operator">-</span> radius<span class="token punctuation">,</span> center_y <span class="token operator">-</span> radius<span class="token punctuation">,</span> center_x <span class="token operator">+</span> radius<span class="token punctuation">,</span> center_y <span class="token operator">+</span> radius<span class="token punctuation">)</span><span class="token punctuation">,</span> fill<span class="token operator">=</span><span class="token number">255</span><span class="token punctuation">)</span>

        <span class="token comment"># Apply the mask to the original image</span>
        result <span class="token operator">=</span> Image<span class="token punctuation">.</span>composite<span class="token punctuation">(</span>img<span class="token punctuation">,</span> Image<span class="token punctuation">.</span>new<span class="token punctuation">(</span><span class="token string">'RGB'</span><span class="token punctuation">,</span> <span class="token punctuation">(</span>w<span class="token punctuation">,</span> h<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">,</span> mask<span class="token punctuation">)</span>

        <span class="token comment"># Convert the result back to a numpy array</span>
        result_images<span class="token punctuation">.</span>append<span class="token punctuation">(</span>np<span class="token punctuation">.</span>array<span class="token punctuation">(</span>result<span class="token punctuation">)</span><span class="token punctuation">)</span>

    <span class="token keyword">return</span> result_images

