X_test <span class="token operator">=</span> np<span class="token punctuation">.</span>concatenate<span class="token punctuation">(</span><span class="token punctuation">[</span>mal_test_final<span class="token punctuation">,</span> ben_test_final<span class="token punctuation">]</span><span class="token punctuation">)</span>

<span class="token comment"># Create labels</span>
